class User {
    constructor(displayName,description,displayIcon,background) {
        this.displayName = displayName
        this.description = description
        this.displayIcon = displayIcon
        this.background = background
    }

    toCard(){
        //* TWORZĘ KARTĘ
        const card = document.createElement("div");
        card.className = "card m-2 text-white bg-dark";

        //* TWORZĘ TYTUŁ KARTY
        
        const cardTitle = document.createElement("div");
        cardTitle.className = "card-title text-center fw-bold mt-2";
        cardTitle.innerHTML = `${this.displayName} <img class="icon" src="${this.displayIcon}"/>`
        card.appendChild(cardTitle);

        //* TWORZĘ BODY DLA KARTY

        const cardBody = document.createElement("div");
        cardBody.className = "card-body";
        cardBody.innerHTML =  `
        <img class="background" src="${this.background}"/>
        <p class="description"> ${this.description}</p>`;
        card.appendChild(cardBody);

        return card;
    }
}

//* DO POBIERAM WYBRANE DANE Z myApiData I DAJE JE DO TABLICY data

function createdata() {
    const data = [];
    myApiData.forEach((v) => {
        data.push(new User(v.displayName, v.description, v.displayIcon, v.background))   
    });
    // console.log(data)
    return data;
}

const data = createdata();

//* GENERUJE KARTY DLA KAŻDEGO UŻYTKOWNIKA
const cardDiv = document.querySelector(".cards");

function generCards(){
    data.forEach((v,i)=>{
        cardDiv.appendChild(v.toCard())
    })
}

generCards()
